import { Header, List } from "semantic-ui-react";

const Videos = ({video}) => {
    return (  
        <List>
            {video.map(video => {
                return (
                    <List.Item key={video.name}>
                        <Header> {video.name} </Header>
                        <List.Content>Views: {video.views}</List.Content>
                        <List.Content>Likes: {video.likes}</List.Content>
                    </List.Item>
                    
                )
            })}
        </List>
    );
}
 
export default Videos;
